		body: '## [26.0.0](https://github.com/renovatebot/renovate/compare/25.76.1...26.0.0) (2021-08-17)\r\n\r\n\r\n### ⚠ BREAKING CHANGES\r\n\r\n* Branches with double hyphens will be changed to single hyphens, which can result in some existing PRs being autoclosed and replacements opened.\r\n* Renovate will now override any package manager cache locations configured in env variables.\r\n* **git-submodules:** Git Submodules cloning now needs to be explicitly enabled.\r\n* **yarn:** It is no longer supported to configure a "yarnrc" override in Renovate config\r\n* **gradle:** Gradle extraction now defaults to JS-based parsing (previously "gradle-lite")\r\n\r\n### Features\r\n\r\n* **terraform:** remove RENOVATE_X_TERRAFORM_LOCK_FILE flag and enable by default ([#11264](https://github.com/renovatebot/renovate/issues/11264)) ([569bee6](https://github.com/renovatebot/renovate/commit/569bee6e7d78956bac61831794ba54272f314e42))\r\n* add dependencyDashboard to config:base ([13532ec](https://github.com/renovatebot/renovate/commit/13532ecd3d5b3fd2ad4a4db912cdc860f378418a))\r\n* **cache:** allow caching of null values ([#11014](https://github.com/renovatebot/renovate/issues/11014)) ([6a361c6](https://github.com/renovatebot/renovate/commit/6a361c6150995632404273d7c255c3727575e48b))\r\n* **config:** improve monorepo names ([#10243](https://github.com/renovatebot/renovate/issues/10243)) ([685e108](https://github.com/renovatebot/renovate/commit/685e1086ae587d10929942bd5e8208f4ca2a1465))\r\n* **git-submodules:** default cloneSubmodules to false ([#10514](https://github.com/renovatebot/renovate/issues/10514)) ([365ed05](https://github.com/renovatebot/renovate/commit/365ed0573a4e0fe7ceb211dba148425996d2767e))\r\n* **go:** Support GOPROXY ([#9150](https://github.com/renovatebot/renovate/issues/9150)) ([edbe6ae](https://github.com/renovatebot/renovate/commit/edbe6aef5c3a647a6cfae4572480b85e5cead24c))\r\n* **travis:** remove supportPolicy ([#11176](https://github.com/renovatebot/renovate/issues/11176)) ([123dc44](https://github.com/renovatebot/renovate/commit/123dc4444ee9a0006966cc4838bac972e8253711))\r\n* centralized cache directory ([#10115](https://github.com/renovatebot/renovate/issues/10115)) ([0e91fda](https://github.com/renovatebot/renovate/commit/0e91fda45182e9cf0b6bf8b488bb816bd064e24f)), closes [#10094](https://github.com/renovatebot/renovate/issues/10094)\r\n* **gradle:** merge gradle-lite into gradle ([#10132](https://github.com/renovatebot/renovate/issues/10132)) ([99eef28](https://github.com/renovatebot/renovate/commit/99eef28ea0390414f77096831e2c9086ae3552f4)), closes [#10091](https://github.com/renovatebot/renovate/issues/10091)\r\n* **yarn:** remove yarnrc config support ([#10114](https://github.com/renovatebot/renovate/issues/10114)) ([2fe4946](https://github.com/renovatebot/renovate/commit/2fe494616da0231278913c55ace8f879c04b9ef4)), closes [#10113](https://github.com/renovatebot/renovate/issues/10113)\r\n\r\n\r\n### Bug Fixes\r\n\r\n* remove double hyphens from branch names ([#11186](https://github.com/renovatebot/renovate/issues/11186)) ([8319b1d](https://github.com/renovatebot/renovate/commit/8319b1df52d3d1ebf3df8e848a101f5ba413e229)), closes [#8260](https://github.com/renovatebot/renovate/issues/8260)\r\n* **gradle:** Use right path to fixtures ([#11067](https://github.com/renovatebot/renovate/issues/11067)) ([058f01b](https://github.com/renovatebot/renovate/commit/058f01b95550d0847a9c60370223555e253acea2))\r\n\r\n\r\n### Tests\r\n\r\n* add http mock ([#11290](https://github.com/renovatebot/renovate/issues/11290)) ([4437106](https://github.com/renovatebot/renovate/commit/4437106c034dd110da11f4ccc4b1f207145d362c))\r\n\r\n\r\n### Documentation\r\n\r\n* improve travis readme ([#11255](https://github.com/renovatebot/renovate/issues/11255)) ([bb37aa8](https://github.com/renovatebot/renovate/commit/bb37aa82fd6333e22fef759189c88d4f94fc448d))\r\n\r\n\r\n### Miscellaneous Chores\r\n\r\n* npm env settings style ([960b64e](https://github.com/renovatebot/renovate/commit/960b64e6f03924ad5d838d0ada074069ff22c215))\r\n* rename config/admin -> config/global ([9150854](https://github.com/renovatebot/renovate/commit/9150854d7512f3de883843fd7c003e1e201f32fa))\r\n* **deps:** update linters to v4.29.1 ([#11292](https://github.com/renovatebot/renovate/issues/11292)) ([b42be6e](https://github.com/renovatebot/renovate/commit/b42be6ecb2f60fc94c6fb5599a9aef66de79707a))\r\n* **deps:** update node.js to fe63fe8 ([#11293](https://github.com/renovatebot/renovate/issues/11293)) ([fdb4acb](https://github.com/renovatebot/renovate/commit/fdb4acbdd7f838b5b94ab74339e77efe8ae767ac))\r\n* prepare v25 legacy releases ([#11288](https://github.com/renovatebot/renovate/issues/11288)) ([6ab6fba](https://github.com/renovatebot/renovate/commit/6ab6fba210da02b355925387c460a9ce26d787a6))\r\n\r\n\r\n### Code Refactoring\r\n\r\n* admin->globalOnly ([56830ee](https://github.com/renovatebot/renovate/commit/56830ee86c07514d49006549fa94c1bdaec4c020))\r\n* config/definitions -> config/options ([750bc16](https://github.com/renovatebot/renovate/commit/750bc1656ebcc7eacc4ad50505e9c195203b17a2))\r\n* drop redundant config:base settings ([a09b85a](https://github.com/renovatebot/renovate/commit/a09b85a21254787f76ec89da4d635451ffc6df67))\r\n* rename config admin functions to global ([bf69924](https://github.com/renovatebot/renovate/commit/bf69924b788f76bb81e24a88cf8124b02f3119c8))\r\n\r\n',
